pragma solidity ^0.4.23;
import "./safeMath.sol";

contract OneThree{
    using SafeMath for uint;
    uint betValue = 1 ether;
    uint returnValue = 2.85 ether;
    uint fee = 0.03 ether;
    uint jackpotValue = 0.12 ether;
    uint userNumber=3;
    mapping(uint => uint) jackpot;
    mapping(uint => address[]) roundToUsers;
    mapping(uint => address[]) betNumToUsers;
    uint betNumber;
    uint roundNumber;
    address owner;
    uint ownerDeposit;

    event Jackpot(address indexed _user, uint _value, uint indexed _round, uint _now);
    event Bet(address indexed _winner,address indexed _user,uint _bet, uint _payBack, uint _now);

    modifier onlyOwner () {
        require(msg.sender == owner);
        _;
    }

    constructor() public {
        roundNumber = 1;
        betNumber = 1;
        owner = msg.sender;
    }

    function() public payable {
        require(msg.value == betValue);
        uint randJackpot = uint(blockhash(block.number - 1)) % 10000;
        if(randJackpot == 0){
            uint randJackpotUser = uint(blockhash(block.number - 1)) % roundToUsers[roundNumber].length;
            address user = roundToUsers[roundNumber][randJackpotUser];
            uint jp = jackpot[roundNumber];
            user.transfer(jp);
            jackpot[roundNumber] = 0;
            emit Jackpot(user, jp, roundNumber, now);
            roundNumber = roundNumber.add(1);
        }

        if(betNumToUsers[betNumber].length < userNumber.sub(1)){
            betNumToUsers[betNumber].push(msg.sender);
            roundToUsers[roundNumber].push(msg.sender);
            emit Bet(address(0), msg.sender, msg.value, 0, now);
        } else {
            roundToUsers[roundNumber].push(msg.sender);
            uint rand = uint(blockhash(block.number - 1)) % userNumber;
            jackpot[roundNumber] = jackpot[roundNumber].add(jackpotValue);
            ownerDeposit = ownerDeposit.add(fee);
            betNumToUsers[betNumber][rand].transfer(returnValue);
            emit Bet(betNumToUsers[betNumber][rand], msg.sender, msg.value, returnValue, now);
            betNumber = betNumber.add(1);
        }
    }

    function withdrawDeposit() public onlyOwner{
        owner.transfer(ownerDeposit);
        ownerDeposit = 0;
    }

    function currentJackpot() public view  returns(uint){
        return jackpot[roundNumber];
    }

}
